import {  MDBContainer, } from 'mdbreact'



import React, { Component } from 'react'
import SimpleReactLightbox from "simple-react-lightbox";
import { SRLWrapper } from "simple-react-lightbox";

export default class Gallery extends Component {
    
    render() {
        return (
            <div>
              <div className="gallery is-section">
                  <MDBContainer>
                  <SimpleReactLightbox>
                  <SRLWrapper>
                  <a href="https://simple-react-lightbox.dev/static/media/unsplash02.ca975786.jpg" data-attribute="SRL">
                        <img src="https://simple-react-lightbox.dev/static/media/unsplash02.ca975786.jpg" alt="Umbrella" />
                        </a>
                        <a href="https://simple-react-lightbox.dev/static/media/unsplash02.ca975786.jpg" data-attribute="SRL">
                        <img src="https://simple-react-lightbox.dev/static/media/unsplash02.ca975786.jpg" alt="Whatever" />
                        </a>
                    </SRLWrapper>
                    </SimpleReactLightbox>
                  
                     
                  </MDBContainer>
              </div>
            </div>
        )
    }
}
